md = 2 ** 32

def search(s, lw, nums):
    st = set()
    l = len(s)
    hs = 0
    for i in range(lw):
        hs = (hs * 26 + nums[i]) % md
    st.add(hs)
    firsthash = pow(26, lw, md)
    for i in range(1, l - lw + 1):
        hs = (hs * 26 - nums[i - 1] * firsthash + nums[i + lw - 1]) % md
        if hs in st:
            return i
        else:
            st.add(hs)
    return -1


class Solution:
    def longestDupSubstring(self, S: str) -> str:
        l = len(S)
        left = 1
        right = l - 1
        ans = ''
        nums = [ord(S[i]) - ord('a') for i in range(l)]
        while left <= right:
            mid = (left + right) // 2
            ts = search(S, mid, nums)
            if ts >= 0:
                ans = S[ts:ts + mid]
                left = mid + 1
            else:
                right = mid - 1
        return ans


s = Solution()
print(s.longestDupSubstring('banana'))
print(s.longestDupSubstring('abcd'))

inpt = ""
print(s.longestDupSubstring(inpt))